import React from 'react';
import { KeyboardDatePicker,MuiPickersUtilsProvider } from "@material-ui/pickers";
import { withStyles, ThemeProvider } from '@material-ui/core/styles';
import {Grid, createMuiTheme} from '@material-ui/core';

import PropTypes from 'prop-types';
import DateFnsUtils from '@date-io/date-fns';

const styles = {
    root : {

    }
}

const defaultMaterialTheme = createMuiTheme({
    palette: {
      primary: lime,
    },
  });


const CustomDatePicker = ({ classes }) => {

    return <ThemeProvider theme={defaultMaterialTheme}>
        <MuiPickersUtilsProvider utils={DateFnsUtils}>
        <Grid container justify="space-around">
            <KeyboardDatePicker
                margin="normal"
                id="date-picker-dialog"
                label="Date picker dialog"
                format="MM/dd/yyyy"
                style={{
                    color : "red"
                }}
                // value={selectedDate}
                // onChange={handleDateChange}
                KeyboardButtonProps={{
                    'aria-label': 'change date',
                }}
            />
        </Grid>
    </MuiPickersUtilsProvider>
    </ThemeProvider>
}

CustomDatePicker.protoTypes = {
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(CustomDatePicker)
